import './Login.css'
import React,{useRef,useEffect}from 'react'
import e from 'express';


export const Login = () => {
    var emailref=useRef();
    var passwordref=useRef();
function handleemail(){
 if(e.key==='Enter'){
     passwordref.current.focus();
 }
}

   useEffect(()=>{

   }) 
  return (
     
    <div className="pt-5">  
            <div className="global-container  main">  
                <div className="card login-form car">  
                    <div className="card-body">  
                        <h3 className="card-title text-center">  Login  </h3>  
                        <div className="card-text">  
                            <form action="/register"  method="post" name="register">  
                                
                                <div className="form-group">  
                                     
                                    <input type="email" name="email" placeholder="Email Id" ref={emailref}  onKeyUp={handleemail}className="form-control form-control-sm"  aria-describedby="emailHelp" autoComplete='new-password' required/>  
                                </div>
                                
                                <div className="form-group">  
                                     
                                    <input type="password" name="password" placeholder="Password" ref={passwordref} className="form-control form-control-sm"  aria-describedby="emailHelp" required/>  
                                </div>
                                
                                <button type="submit" className="btn btn-primary btn-block"> Login </button>  
                                
                                <div className="sign-up">  
                                    Don't have an account? <a href="login.html"> Register</a>  
                                </div>  
                            </form>  
                        </div>  
                    </div>  
            </div>  
    </div>
</div>

  )
}
